// Proxy.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Proxy {
    address public admin;
    address public currentImplementation;

    constructor(address _admin, address _initialImplementation) {
        admin = _admin;
        currentImplementation = _initialImplementation;
    }

    function upgradeImplementation(address newImplementation) external {
        require(msg.sender == admin, "Only admin can upgrade implementation");
        currentImplementation = newImplementation;
    }

    fallback() external payable {
        address _impl = currentImplementation;
        require(_impl != address(0), "Implementation not found");

        // Forward the call to the implementation contract
        (bool success, ) = _impl.delegatecall(msg.data);
        require(success, "Forwarding failed");
    }
}

